import React, {Component} from "react";

import safe from "../images/safe.png";

export default class AccountInfo extends Component {

    constructor(props) {
        super(props);

        this.state = {

            // Uživatel
            user: {
                id: this.props.userID,
                name: "",
                surname: "",
                email: "",
                clientNumber: 0,
                password: "",
                balance: 0,
                currency: ""
            },
        }
    }

    render() {

        return(
            <div id="account">

                <img src={safe} alt="Safe" />


            </div>
        )
    }

}
